### What is Duck Typing?

Duck typing is a concept in programming that states that if it walks like a duck and quacks like a duck, then it's a duck. In other words, if an object looks like it has the properties and methods of a certain type, it can be treated as if it were of that type.

### How does Duck Typing relate to TypeScript?

TypeScript uses a concept called structural typing, which is similar to duck typing. In TypeScript, if an object has the same shape as a type, it can be treated as if it were of that type. This means that TypeScript will not check the type of an object at compile-time, but rather at runtime.

